import React, {useRef} from 'react';
import Navbar from './components/Navbar/Navbar';
import Banner from './components/Landing/Banner/Banner';
import './App.scss'
import Services from './components/Landing/Services/Services';


export default function App(props) {
  const home = useRef(null);
  const services = useRef(null);
  const testimonial = useRef(null);
  const about = useRef(null);
  const reachout = useRef(null);
  const scrollToElement = (id) => {
      window.scrollTo({
          top: id.current.offsetTop,
          behavior: "smooth"
      });
  };
  return (
    <>
      <Navbar scrollToElement = {this.scrollToElement}/>
      <div ref={home} className='wrapper' id='home'>
        <Banner />
      </div>
      <div ref={services} className='wrapper' id='services'>
        <span className='wrapper--title'>Our Services</span>
        <Services />
      </div>
    </>

  );
}
